  {name: "Berrins", description: "Bespoke spaces in local places for people who enjoy the freedom to choose where they work.meet.connect\r\n\r\nStop being distracted by the household chores whilst trying to work from home. Impress your clients and take that meeting out of the coffee shop and bring it in here. Save on that monthly airfare ticket to visit your interstate clients, use our High Def Video Conferencing facilities instead.", url: "www.berrins.com", twitter: "berrinsmanly", facebook: "https://www.facebook.com/berrins.manly", google: "", employees: "", slug: "berrins", address: " 2/40 E Esplanade, Manly NSW 2095", hiring: false, image: "BERRINS_Facebook_logo_Blk.jpg", email: "info@berrins.com", phone: "(02) 9977 6660", linkedin: nil, github: nil, latitude: -33.7997755, longitude: 151.2854945, gmaps: true, owner: 99, responsible: true},
  {name: "Antonym Pty Ltd", description: "At Antonym Media we are passionate about providing an exceptional creative and production service, without the price tag of a large creative agency. \r\n\r\nAt the core of Antonym Media are Andrew and Lou, who have an array of complementary experience in marketing, advertising and production. \r\n\r\nWhether youre after ideas, design or require full campaign creative and production, Antonym Media has a network of experienced creatives and crew ready to be immersed in your project. \r\n\r\nServices we provide: \r\nIdeas and concept generation \r\nAdvertising and content production \r\nBrand and logo design \r\nGraphics and Animation \r\nPhotography ", url: "www.antonym.net.au", twitter: "", facebook: "https://www.facebook.com/Antonymmedia", google: "", employees: "2-5", slug: "antonym-pty-ltd", address: "1/44 Golf Parade", hiring: false, image: "WEB_LOGO_cropped.jpg", email: "lou@antonym.net.au", phone: "0439 191 047", linkedin: nil, github: nil, latitude: -38.378607, longitude: 144.825695, gmaps: true, owner: 119, responsible: true},
  {name: "MedalTally", description: "MedalTally is a small, independent, design agency specialising in brand identity, packaging and consumer marketing.\r\nAfter 15 years working for the main players in the packaging design industry, Anneke Zilich decided to concentrate on projects that she could be passionate about.\r\nWe create new brands, we research and refresh existing brands and help make strong brands even stronger across all platforms.\r\nWe think about your brand in its entirety; from brand strategy and brand architecture, to identity development and roll-out.\r\nOur passion is designing packaging that sells and brands that consumers connect with.", url: "www.medaltally.com", twitter: "", facebook: "", google: "", employees: "2-5", slug: "medaltally", address: "23/53 O'Brien Street, Bondi Beach, 2026 NSW", hiring: false, image: "medaltallylogoBD2.jpg", email: "annekez@medaltally.com", phone: "0410663402", linkedin: nil, github: nil, latitude: -33.888713, longitude: 151.268102, gmaps: true, owner: 118, responsible: true},
  {name: "In Marketing We Trust", description: "We help clients earn their traffic & profit rather than pay for it.\r\nWe focus on strategies and tactics that add value to your business\r\nOur solutions aim for lowest cost of customer acquisition.\r\nWe use Inbound Marketing to deliver traffic. We are SEO experts", url: "http://www.inmarketingwetrust.com.au", twitter: "@Inmktgwetrust", facebook: "", google: "", employees: "2-5", slug: "in-marketing-we-trust", address: "57 Darley Rd", hiring: true, image: "Logo400x300_Transparent.png", email: "info@inmarketingwetrust.com.au", phone: "", linkedin: nil, github: nil, latitude: 39.8069455, longitude: -75.4560705, gmaps: true, owner: 58, responsible: true},
  {name: "Apium", description: "My name is Josie, I am a Program Manager professional by day, and work in large corporations consulting for digital, transformation and brand related programs, but by night and in my day dreams, I am a budding Entrepreneur brimming with start-up ideas. \r\n\r\nI have a background in telco engineering, and graduated top of the class, as the sole chick in the course. I am passionate about getting more women into technology and as such am interested in founding start-ups with chick only teams. Sorry guys.\r\n\r\nI am the founder of Apium, a chick team only start-up interested in creating digital solutions for women by women. \r\n\r\nI am currently about to kick off the MVP phase of a start-up, for one of my companies, AiryPoppins, and am looking for a TECHNICAL CO-FOUNDER (female only) to help me develop a subscription website and mobile application. \r\n\r\nI am really looking for a technical generalist or uber nerd, who has either the knowledge to do or the contacts to delegate, and can execute on all things technical. This is not a paid gig, this is start up for the love and hope of greatness. \r\n\r\n", url: "", twitter: "missjflynn", facebook: "", google: "", employees: "1", slug: "apium", address: "5/40 Sutherland St, Sydney", hiring: true, image: nil, email: "josie.flynn1@gmail.com", phone: "61422222323", linkedin: nil, github: nil, latitude: -33.924917, longitude: 151.200846, gmaps: true, owner: 117, responsible: true},
  {name: "The Coder Factory", description: "The Coder Factory is a new type of organisation, one that provides technology education, employment opportunities and supports your startup ambitions.", url: "http://thecoderfactory.com", twitter: "@coderfactory", facebook: "https://www.facebook.com/pages/The-Coder-Factory/347905435343297", google: "https://plus.google.com/100818528139080406377", employees: "2-5", slug: "the-coder-factory", address: "Chippendale, NSW", hiring: false, image: "logo2.png", email: "pete@thecoderfactory.com", phone: "", linkedin: nil, github: nil, latitude: -33.8844802, longitude: 151.1973404, gmaps: true, owner: 1, responsible: true},
  {name: "projectCREATE", description: "Are you ready to create?\r\n\r\nAt projectCREATE we build websites, apps and software combining the art of beautiful and dynamic design with innovative technology to create solutions for you and your business. Our designs not only look superb, but also provide exceptional functionality and all at incredible value for money.", url: "http://www.projectcreate.com.au", twitter: "", facebook: "", google: "", employees: "6-10", slug: "projectcreate", address: "Waterloo, Sydney", hiring: false, image: "Logo_on_Black_300px_x_300px.jpeg", email: "michelle@projectcreate.com.au", phone: "61415272375", linkedin: nil, github: nil, latitude: -33.8960461, longitude: 151.1999952, gmaps: true, owner: 116, responsible: true},
  {name: "Ohio Surry Hills", description: "Situated in the heart of Surry Hills, Ohio occupies a well presented open-flow office boasting high ceilings, freshly laid floorboards, and an inspiring orange colour scheme. (Everyone likes orange, right?). A southerly aspect and generous windows offer an invigorating dose of natural light without any 3pm afternoon glare.\r\n\r\nTenants can enjoy use of our private office suites, meeting rooms, group workbenches, casual workspaces, kitchen and bathroom facilities, plus all-you-can-eat Wifi, printing and phone calls.\r\n\r\nWith an on-site cafe, local bars and restaurants galore, and the police station just up the road in case everything goes pear-shaped, 162 Goulburn Street is the ideal place to set up your coworking space or virtual office.", url: "http://ohiosurryhills.com.au/", twitter: "https://twitter.com/OhioSurryHills", facebook: "https://www.facebook.com/OhioSurryHills", google: "", employees: "2-5", slug: "ohio-surry-hills", address: "Level 2, 162 Goulburn Street, Surry Hills NSW 2010", hiring: false, image: "Office_Space_2.jpg", email: "jamielee@redant.com.au", phone: "0401 247 969", linkedin: nil, github: nil, latitude: -33.8788143, longitude: 151.2122119, gmaps: true, owner: 115, responsible: true},
  {name: "The Saljar Group", description: "We're perfect for your startup. If you don't succeed, we starve. Sound like someone you'd like in your corner? Click on our logo to the left for the full profile.\r\n\r\nWe help innovators, high-tech players and startups with legal, commercialisation and funding needs. We prefer to do this on a no-cost/success-share basis if feasible.\r\n\r\nWe're the perfect blend of startup lawyer who understands the non-legal business and commercial issues that startups face, and business mentor/advisor who understands the legal issues you'll face. So, we're perfect for startups.\r\n\r\nAnd what's best, we'd prefer NOT to bill you for our help. We prefer to work on a risk-share and success-share basis  we know we can do this because we think like (and we essentially are) an investor, so we know if we can afford to take the punt on your startup team (and if we can't, we'll tell you why and help you get more attractive to investors).\r\n\r\nSome of the things we can help you with are: corporate structure, set-up, IP management and protection strategy, business-model development, commercial strategy, capital raising, non-executive directorship/board advisory roles, and negotiation of agreements with partners, contributors, suppliers, customers and investors.\r\n\r\nWe help you avoid mistakes and common pitfalls, and increase your prospects of success. We have to; our skin is in the game  if you don't succeed, we starve. Sound like someone you'd like in your corner?\r\n\r\nWe love startups, so get in touch for a friendly (and no cost) chat any time.", url: "http://www.saljar.com/Proposition_for_startups.html", twitter: "", facebook: "", google: "", employees: "", slug: "the-saljar-group", address: "Sydney 2000", hiring: true, image: "TSG_profile_pic.jpg", email: "info@saljar.com", phone: "", linkedin: nil, github: nil, latitude: -33.873651, longitude: 151.2068896, gmaps: true, owner: 110, responsible: true},
