  {user_id: 58, about: "Suit by day, Geek by night. I am the digital marketing they need, not the one they deserve. I am... I am not batman :(\r\n----------------------\r\nSerious version:\r\nFrederic (aka Freddy Chanut) is a SEO expert and MD of In Marketing We Trust, a digital agency based in Sydney.Frederic has a background in digital and inbound marketing gathered through work in Europe, US and Australia.Prior to establishing In Marketing We Trust, Frederic worked on numerous high-profile businesses helping them develop their digital marketing assets\r\n", email: "", phone: "", url: "http://www.inmarketingwetrust.com.au/frederic-chanut-managing-director/", twitter: "@inmktgwetrust", facebook: "", google: "", slug: "frederic-chanut", mentor: nil, image: "Fred_BW_-_353x500.jpg", name: "Frederic Chanut", tagline: "SEO specialist & Digital marketing geek. Work with market makers (big biz or disrupters)", linkedin: "", github: ""},
