  {user_id: 92, about: "By way of title I am the Associate Director, Corporate Finance and Transactional Services with Azure Group.\r\n\r\nAzure Group is a boutique chartered accounting practice established in 2002 with the objective of offering sophisticated accounting services combined with proactive strategic commercial advice to the privately owned SME sector, along with the small to mid cap listed company sector.\r\n\r\nI have two roles within Azure Group.\r\n\r\nMy primary role is in Azure's corporate finance and transactional services activities.\r\n\r\nComplimenting my primary role is also to be a CFO, Azure Advisory & Consulting Services.\r\n\r\nIn our corporate finance & transactional services division, we are involved in advising on mergers, acquisitions and divestments; leading transactional due diligence; enterprise valuations; capital placement strategies and arranging finance including the facilitation of private and institutional incubation, venture capital and private equity. We do this across a broad range of sectors, but especially technology (including online retail), telecommunications and media and property. \r\n\r\nIn the context of the CFO service offering, I am in a team of consulting or virtual CFOs, where our primary scope of activity is engaging with SME's with a need to tap, in my own case, into over 25 years of experience in wide ranging finance, operational, strategic and commercial management, in a cost effective and \"turn key\" manner. \r\n\r\nThe CFO function was established in recognition that Australian SMEs rarely get appropriate strategic commercial advice, as the investment to attract an experienced CFO is normally out of reach of most SMEs.\r\n\r\nAzure has offices located in Sydney, South-East Queensland, and Shanghai, China.\r\n\r\nThe firm also offers advisory services across all the finance functions including tax, accounting, company secretarial and wealth management.", email: "aharris@azuregroup.com.au", phone: "+614089