  {user_id: 24, about: "I'm an engineer with more than 20 years experience with energy and climate change. I cofounded my first startup in the early 90s in satellite communications. Since then, apart for a brief sojourn lecturing at UTS, I have worked around the world mostly in developing countries for various NGOs and the likes of World Bank and United Nations. I specialised at making decentralised energy services into good business even in difficult market settings. When I look at the traditional utility sector, even in Australia and USA, I'm struck by how constrained they are in their thinking around distributed generation. They're deep in a mindset which blinds them with fear and trepidation at the changes that are coming with new renewable energy technologies. I think its time to shake up the electricity sector and to demonstrate that decentralised services can have mass market appeal which benefits both end-users and the utilities.", email: "andrew.mears@switchdin.com", phone: "+61421131550", url: "www.switchdin.com", twitter: "@switchdin", facebook: "", google: "", slug: "andrew-mears", mentor: nil, image: "2012-04-06_13.08.44.jpg", name: "Andrew Mears", tagline: "clean tech business innovator", linkedin: "au.linkedin.com/in/andrewmears", github: ""},
